import React from "react";
import Card from "./Card";
import contacts from "../contacts"

function App() {
  return (
   <div>
     <Card 
        name = {contacts[0].name}
        imgURL = {contacts[0].imgURL}
        phone ={contacts[0].phone}
        email ={contacts[0].email}
     />
     <Card />
     <Card />
   </div>
  );
}

export default App;
